("1","1","2018-11-22 03:18:04","2018-11-22 03:18:04","Chúc mừng đến với WordPress. Đây là bài viết đầu tiên của bạn. Hãy chỉnh sửa hay xóa bài viết này, và bắt đầu viết blog!","Chào tất cả mọi người!","","publish","open","open","","chao-moi-nguoi","","","2018-11-24 16:50:05","2018-11-24 09:50:05","","0","https://tppone.com/demo/noithat6/?p=1","0","post","","1"),
("2","1","2018-11-22 03:18:04","2018-11-22 03:18:04","[gap height=\"15px\"]\n\n[row padding=\"0px 0px 0 0px\" class=\"slider-row\"]\n\n[col span__sm=\"12\" padding=\"0px 0px 0 0px\"]\n\n[ux_slider nav_size=\"normal\" nav_color=\"dark\" bullets=\"false\"]\n\n[ux_image id=\"61\" image_size=\"original\" height=\"30%\" animate=\"bounceInDown\"]\n\n[ux_image id=\"65\" image_size=\"original\" height=\"30%\" animate=\"flipInX\"]\n\n[ux_image id=\"72\" image_size=\"original\" height=\"30%\" animate=\"bounceIn\"]\n\n\n[/ux_slider]\n\n[/col]\n\n[/row]\n[section label=\"Giới thiệu\" class=\"gioi-thieu\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Thiết kế kiến trúc, thiết kế thi công nội thất\" tag_name=\"h2\" color=\"rgb(255, 102, 0)\"]\n\n<p style=\"text-align: center;\"><span style=\"color: #282828; font-size: 95%;\">[NHADEP365] chuyên tư vấn thiết kế kiến trúc, thiết kế nội thất biệt thự, thiết kế nội thất chung cư, thiết kế nội thất nhà lô, thi công hoàn thiện nội thất đồng bộ và những sản phẩm nội thất sản xuất thủ công. Với đội ngũ Kiến trúc sư chính quy hơn 10 năm kinh nghiệm vẫn miệt mài hoạt động thiết kế sáng tạo , đã thành dẫn chứng sắt thép cho đam mê đích thực với nghề thiết kế kiến trúc và nội thất. Trải qua rất nhiều công trình thực tế với những khách hàng kỹ tính nhất, Nhà Đẹp 365 luôn nỗ lực từng ngày để thực sự trở thành thương hiệu thiết kế kiến trúc và thiết kế nội thất chuyên nghiệp Việt nam.</span></p>\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Dịch vụ\" class=\"dich-vu\" padding=\"0px\"]\n\n[row col_style=\"divided\"]\n\n[col span=\"3\" span__sm=\"6\" align=\"center\"]\n\n[featured_box img=\"188\" img_width=\"120\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 100%; ;\"><strong>Cam kết vàng</strong></span></h3>\n<p style=\"text-align: center;\"><span style=\"font-size: 90%; color: #000000;\">Cam kết hoàn thành tiến độ chính xác, chất lượng đảm bảo thỏa thuận</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"191\" img_width=\"120\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 100%;\">Hỗ trợ tận nơi</span></h3>\n<p style=\"text-align: center;\"><span style=\"font-size: 90%; color: #000000;\">Chúng tôi hỗ trợ khách hàng tận nơi nội thành Hà Nội và Tp. HCM</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"193\" img_width=\"120\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\"><span style=\" font-size: 100%;\">Hợp đồng rõ ràng</span></h3>\n<p style=\"text-align: center;\"><span style=\"font-size: 90%; color: #000000;\">Làm việc phải có hợp đồng để đôi bên hợp tác thành công và bảo đảm</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"195\" img_width=\"120\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 100%;\">Kinh nghiệm thực tế</span></h3>\n<p style=\"text-align: center;\"><span style=\"font-size: 90%; color: #000000;\">Với hơn 15 năm kinh nghiệm đem lại giá trị vững bền cho khách hàng</span></p>\n\n[/featured_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Biệt thự\" class=\"danh-muc-bai-viet\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title text=\"Thiết kế biệt thự\" icon=\"icon-star\" link_text=\"+ Xem tất cả\" link=\"/thiet-ke-biet-thu/\"]\n\n[gap height=\"15px\"]\n\n[blog_posts style=\"normal\" type=\"row\" columns__md=\"1\" cat=\"3\" show_date=\"false\" excerpt=\"false\" comments=\"false\" image_height=\"126%\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Nhà phố\" class=\"danh-muc-bai-viet\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title text=\"Thiết kế nhà phố\" icon=\"icon-star\" link_text=\"+ Xem tất cả\" link=\"/thi-cong-nha-pho/\"]\n\n[gap height=\"15px\"]\n\n[blog_posts style=\"normal\" type=\"row\" columns__md=\"1\" cat=\"7\" show_date=\"false\" excerpt=\"false\" comments=\"false\" image_height=\"