x_price_table]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"195\" img_width=\"92\" pos=\"left\"]\n\n<h3><span style=\"color: #000000;\">Thiết kế</span></h3>\n<p><span style=\"font-size: 95%;\">Thiết kế kiến trúc, khai triển chi tiết bản vẽ, sơ đồ điện nước, kết cấu, phối cảnh ngoại thất, nội thất không gian 3 chiều, hồ sơ kỹ thuật thi công, hồ sơ xin cấp phép xây dựng, giám sát tác giả.</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"193\" img_width=\"92\" pos=\"left\"]\n\n<h3><span style=\"color: #000000;\">Thi công phần thuê</span></h3>\n<p><span style=\"font-size: 95%;\">Lập khái toán, liệt kê rõ chủng loại và khối lượng vật tư như: sắt thép, xi măng, ống nước, dây điện… Mua bảo hiểm cho công trình nhằm mục đích giảm thiểu mọi rủi ro trong quá trình thi công.</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"191\" img_width=\"92\" pos=\"left\"]\n\n<h3><span style=\"color: #000000;\">Hoàn thiện</span></h3>\n<p><span style=\"font-size: 95%;\">Lắp đặt cửa, lót sàn, trần thạch cao, sơn. Lắp đặt thiết bị vệ sinh, vòi nước, vòi sen tắm… Lắp đặt trang thiết bị điện: công tắc, đèn chiếu sáng, máy bơm, hệ thống cảm ứng thông minh…</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"188\" img_width=\"92\" pos=\"left\"]\n\n<h3><span style=\"color: #000000;\">Nội thất</span></h3>\n<p><span style=\"font-size: 95%;\">Liệt kê đầy đủ các vật dụng nội thất, chất liệu, mã số màu và giá thành cho mỗi sản phẩm. Thi công, sản xuất hoặc đặt hàng nội thất theo chỉ định của chuyên viên thiết kế nội thất.</span></p>\n\n[/featured_box]\n\n[/col]\n[col span__sm=\"12\" class=\"cot12-2\"]\n\n<h2 style=\"text-align: center;\">Chúng tôi với 15+ năm kinh nghiệm, bạn có thể làm việc với chúng tôi tại bất kỳ tỉnh thành nào!</h2>\n\n[/col]\n\n[/row]\n\n[/section]","Trang chủ","","publish","closed","open","","trang-chu","","","2018-11-24 