("17","1","2018-11-22 11:49:24","2018-11-22 04:49:24","[ux_image id=\"61\" image_size=\"original\" height=\"25%\"]\n\n[gap]\n\n[row]\n\n[col span=\"6\" span__sm=\"12\"]\n\n<h2>Về chúng tôi</h2>\n<p>Tiền thân là  một cơ sở sản xuất nhỏ Nội thất Vitago đã mạnh dạn đầu tư trang thiết bị máy móc cùng với đội ngũ công nhân có tay nghề cao và nhiệt tình sáng tạo trong công việc đã giúp cho Nội thất việt có một cơ sở lớn mạnh. Cùng với thời gian Nội thất Vitago ngày càng lớn mạnh và phát triển.</p>\n[gap height=\"16px\"]\n\n[row_inner style=\"small\"]\n\n[col_inner span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"817\" img_width=\"50\" pos=\"left\"]\n\n<p>Tư vấn 24/7<br />\nhoàn toàn miễn phí</p>\n\n[/featured_box]\n[gap]\n\n[featured_box img=\"819\" img_width=\"50\" pos=\"left\"]\n\n<p>Thanh toán tiền<br />\nkhi bàn giao sản phẩm</p>\n\n[/featured_box]\n\n[/col_inner]\n[col_inner span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"821\" img_width=\"50\" pos=\"left\"]\n\n<p>Vận chuyển<br />\nmiễn phí nội thành Hà Nội</p>\n\n[/featured_box]\n[gap]\n\n[featured_box img=\"823\" img_width=\"50\" pos=\"left\"]\n\n<p>0972939830<br />\nHotline tư vấn</p>\n\n[/featured_box]\n\n[/col_inner]\n\n[/row_inner]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[ux_image id=\"297\" image_size=\"original\" height=\"51%\"]\n\n\n[/col]\n\n[/row]\n[row]\n\n[col span=\"7\" span__sm=\"12\"]\n\n[gap]\n\n<h2>Thiết kế biệt thự</h2>\n<p>Phòng khách nhà chung cư, biệt thự không đơn giản chỉ là nơi gặp gỡ nói chuyện của những người trưởng thành mà còn là nơi giải trí và diễn ra nhiều hoạt động chung của cả gia đình.<br />Để thiết kế một phòng khách đẹp không hề đơn giản, chúng ta cần làm việc với các chuyên gia thiết kế để chọn lựa giữa vô vàn ý tưởng. Bởi thế, NỘI THẤT VITAGO luôn cố gắng để mang lại không gian phòng khách những điều tuyệt vời nhất!</p>\n\n[/col]\n[col span=\"5\" span__sm=\"12\"]\n\n[ux_image id=\"165\" image_size=\"original\" height=\"50%\"]\n\n\n[/col]\n\n[/row]\n[row]\n\n[col span=\"5\" span__sm=\"12\"]\n\n[ux_image id=\"250\" image_size=\"original\" height=\"121%\"]\n\n\n[/col]\n[col span=\"7\" span__sm=\"12\"]\n\n[gap]\n\n[gap height=\"48px\"]\n\n<h2>Thiết kế nhà phố</h2>\n<p>Phong cách hiện đại đang được nhiều người lựa chọn trong thiết kế nội thất, vì nó không chỉ mang lại một không gian đẹp và tinh tế mà nó còn cho bạn một không gian để thỏa sức sáng tạo theo phong cách riêng của mình để có được một căn phòng ngủ đẹp phù hợp với cuộc sống năng động và hiện đại ngày nay.</p>\n<p>Hãy để NỘI THẤT VITAGO mang đến không gian phòng ngủ của bạn những điều tuyệt vời nhất nhé!</p>\n<h2>Thiết kế nội thất</h2>\n<p>thiết kế nội thất phòng bếp một cách khoa học, tổ chức sắp đặt thiết bị hợp lý có ý đồ sẽ làm bạn thấy thú vị với một không gian bếp rộng rãi, thoáng mát bởi bạn sẽ phải làm một số việc quan trọng trong bếp như nấu ăn cho gia đình, tổ chức các bữa tiệc với bạn bè, họ hàng….tất cả để tạo nên những khoảnh khắc hạnh phúc và thân mật bên người thân.</p>\n<p>Hãy đển NỘI THẤT VITAGO mang lại sự ấm cúng, thân thiện và vô cùng tiện nghi cho căn bếp của bạn nhé!</p>\n\n[/col]\n\n[/row]\n[row]\n\n[col span__sm=\"12\" padding=\"15px 15px 15px 15px\" bg_color=\"rgb(249, 249, 249)\"]\n\n<h2>Chúng tôi có thể làm gì cho bạn?</h2>\n<p>Chúng tôi với đội ngũ kĩ sư, kiến trúc sư lành nghề với nhiều năm kinh nghiệm về lĩnh vực tư vấn và thiết kế nội thất sang trọng, ấn tượng cho các hộ gia đình, các biệt thự, chung cư,... Nhằm mang đến không gian sống lý tưởng, hoàn hảo cho các gia đình trẻ Việt Nam. Với phương châm vì khách hàng phục vụ, Chúng tôi luôn lắng nghe ý kiến phản hổi của khách hàng về yêu cầu thiết kế và chất lượng sản phẩm.</p>\n<p>Với nguồn gỗ tự nhiên ngày càng cạn kiệt, và để đáp ứng nhu cầu sử dụng gỗ trong thiết kế nội thất, sản xuất nội thất gia dụng trong gia đình, ván gỗ nhân tạo ra đời, với nhiều chủng loại phong phú, màu sắc đa dạng, phù hợp cho nhiều mục đích sử dụng khác nhau trong nội thất, đặc biệt ván gỗ nhân tạo có đặc tính cơ lý ưu việt là không cong vênh, co ngót nên hiện nay gỗ công nghiệp thường được ứng dụng nhiều trong thiết kế nội thất hiện đại.</p>\n<p>Các loại gỗ công nghiệp phổ biến hiện nay:</p>\n\n[/col]\n\n[/row]\n[row]\n\n[col span=\"6\" span__sm=\"12\"]\n\n<h3>Ván dăm MFC:</h3>\n<p> là gỗ nhân tạo được sản xuất từ nguyên liệu gỗ rừng trồng (bạch đàn, keo, cao su...), có độ bền cơ lý cao, kích thước bề mặt rộng, phong phú về chủng loại. Mặt ván được dán phủ bằng những loại vật liệu trang trí khác nhau: melamine, veneer (gỗ lạng)... Ván MFC chủ yếu sử dụng để trang trí nội thất, sản xuất đồ mộc gia đình, công sở. Ván được sản xuất bằng quá trình ép dăm gỗ đã trộn keo, tương tự như MDF nhưng gỗ được xay thành dăm, nên chúng có chất lượng kém hơn ván sợi.</p>\n<p>Công nghệ dán phủ mặt và cạnh ván thỏa mãn nhiều yêu cầu về hình dạng và kích thước, gồm hai loại sản phẩm ván dăm trơn và MFC. Ván dăm trơn là loại phổ biến trên thị trường, khi sử dụng thường được phủ veneer, sơn, hoặc phủ PU. Với sản phẩm MFC, hai mặt được phủ một lớp melamine nhằm tạo vẻ đẹp, chống ẩm và trầy xước.</p>\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[ux_image id=\"285\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n[row]\n\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"297\" image_size=\"original\" height=\"64%\"]\n\n[gap height=\"11px\"]\n\n\n[/col]\n[col span=\"8\" span__sm=\"12\"]\n\n<h3>Ván ghép thanh (còn gọi gỗ ghép)</h3>\n<p>Được sản xuất từ nguyên liệu chính là gỗ rừng trồng. Những thanh gỗ nhỏ đã qua xử lý hấp sấy, trên dây chuyền công nghệ tiên tiến, thiết bị hiện đại, gỗ được cưa, bào, phay, ghép, ép, chà và sơn phủ trang trí. Ván ghép thanh được sử dụng rộng rãi trong các lĩnh vực sản xuất đồ mộc, trang trí nội thất, sản xuất ván sàn và nhiều sản phẩm khác.</p>\n<p>Có 4 cách thức gỗ ghép song song, mặt, cạnh, giác. Gỗ ghép song gồm nhiều thanh gỗ cùng chiều dài, có thể khác chiều rộng, ghép song song với nhau. Gỗ ghép mặt gồm nhiều thanh gỗ ngắn, ở hai đầu được xẻ theo hình răng lược rồi ghép lại thành những thanh có chiều dài bằng nhau, rồi tiếp tục ghép song song các thanh, cho nên chỉ nhìn thấy vết ghép hình răng lược trên bề mặt ván, thị trường Nhật Bản rất chuộng cách ghép thanh này.</p>\n\n[/col]\n\n[/row]\n[row]\n\n[col span__sm=\"12\" padding=\"15px 15px 15px 15px\" bg_color=\"rgb(246, 246, 246)\"]\n\n<p>Đội ngũ thợ lành nghề với thâm niên từ 5-20 năm kinh nghiệm mang đến cho quý khách những sản phẩm chất lượng tốt nhất, thời gian thi công nhanh chóng. Trung bình thiết kế và thi công nội thất 1 căn nhà chỉ trong vòng 7-10 ngày.</p>\n<h2>Mục tiêu của chúng tôi</h2>\n[row_inner]\n\n[col_inner span=\"4\" span__sm=\"12\"]\n\n<p>Không ngừng cải tiến công nghệ, nâng cao năng suất và chất lượng sản phẩm.<br />\nĐể trở thành một công ty hàng đầu về sản xuất và cung cấp các sản phẩm gỗ công nghiệp trong một thị trường sôi động và luôn luôn biến đổi không ngừng, chúng tôi luôn luôn chú trọng trong việc nâng cao năng suất và chất lượng của sản phẩm cũng như hoàn thiện hệ thống công nghệ máy móc thiết bị sản xuất</p>\n[gap height=\"12px\"]\n\n[ux_image id=\"285\" image_size=\"original\" height=\"50%\"]\n\n\n[/col_inner]\n[col_inner span=\"4\" span__sm=\"12\"]\n\n<p>Luôn luôn hướng tới khách hàng<br />\nLuôn mang tới khách hàng những sản phẩm và dịch vụ với chất lượng tốt nhất và nhanh nhất . Đáp ứng đa dạng các nhu cầu của khách hàng bằng các dịch vụ gia tăng. Thiết lập một mối quan hệ thân thiết, bền vững với khách hàng.</p>\n[gap height=\"15px\"]\n\n[ux_image id=\"288\" image_size=\"original\"]\n\n<p>Hợp tác, chia sẻ, tin cậy<br />\nSức mạnh tập thể là nhân tố tạo nên sức mạnh của Nội Thất Vitago. Đoàn kết được tạo ra từ sự kết hợp, bổ sung giữa các cá nhân với năng lực và cá tính riêng biệt. Thiết lập môi trường làm việc tin tưởng và tôn trọng lẫn nhau. Tạo cơ hội cho sự phát triển của mọi thành viên Nội Thất Vitago.</p>\n\n[/col_inner]\n[col_inner span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"297\" image_size=\"original\"]\n\n<p>Năng động, sáng tạo<br />\nĐây là mục tiêu luôn được chú trọng khuyến khích và phát huy ở Nội Thất Vitago. Chúng tôi hiểu rằng tự do đổi mới và năng động sáng tạo là yếu tố tiên quyết để giúp Nội Thất Vitago trở thành công ty hàng đầu. Mối trường năng động và cởi mở ở Nội Thất Vitago luôn khuyến khích và tiếp nhận những cá nhân sáng tạo và năng động.</p>\n\n[/col_inner]\n\n[/row_inner]\n\n[/col]\n\n[/row]","Giới thiệu","","publish","closed","closed","","gioi-thieu","","","2018-11-24 18:10:34","2018-11-24 11:10:34","","0","https://tppone.com/demo/noithat6/?page_id=17","0","page","","0"),
