("892","1","2018-11-25 13:06:39","2018-11-25 06:06:39","[row]\n\n[col span__sm=\"12\"]\n\n[ux_image id=\"72\" image_size=\"original\"]\n\n[/col]\n\n[/row]\n\n[section label=\"Bảng giá thiết kế\" class=\"bang-gia\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Bảng giá thiết kế Kiến trúc và Nội thất\" tag_name=\"h2\" color=\"rgb(255, 84, 0)\"]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_price_table title=\"Gói thông dụng\" price=\"120.000 đ/m2\" description=\"Hồ sơ gồm: Kiến trúc, kết cấu, điện nước\" radius=\"4\" depth_hover=\"0\"]\n\n[bullet_item text=\"Thời gian hoàn thành: 3 tuần\"]\n\n[bullet_item text=\"Bảo hanh 4 năm\"]\n\n[button text=\"+ Xem chi tiết\" letter_case=\"lowercase\" radius=\"4\" link=\"#\" target=\"_blank\"]\n\n[/ux_price_table]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_price_table title=\"Gói tiết kiệm\" price=\"700.0000/hs\" description=\"Hồ sơ gồm: mặt bằng, mặt đứng, phối cảnh công trình, bản vẽ chi tiết\" featured=\"true\" radius=\"4\" depth_hover=\"0\"]\n\n[bullet_item text=\"Thời gian hoàn thành: 1 tuần\"]\n\n[bullet_item text=\"Bảo hanh 4 năm\"]\n\n[button text=\"+ Xem chi tiết\" letter_case=\"lowercase\" radius=\"4\" link=\"#\" target=\"_blank\"]\n\n[/ux_price_table]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_price_table title=\"Gói cao cấp 1\" price=\"200.000 đ/m2\" description=\"Hồ sơ gồm: Kiến trúc công trình, kết cấu, thiết kế nội thất, điện nước\" radius=\"4\" depth_hover=\"0\"]\n\n[bullet_item text=\"Thời gian hoàn thành: 5 tuần\"]\n\n[bullet_item text=\"Thời gian hoàn thành: 5 tuần\"]\n\n[button text=\"+ Xem chi tiết\" letter_case=\"lowercase\" radius=\"4\" link=\"#\" target=\"_blank\"]\n\n[/ux_price_table]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_price_table title=\"Gói cao cấp 2\" price=\"250.000 đ/m2\" description=\"Hồ sơ gồm: Kiến trúc, nội thất, điện nước, kết cấu, tư vấn hoàn thiện\" radius=\"4\" depth_hover=\"0\"]\n\n[bullet_item text=\"Thời gian hoàn thành: 5 tuần\"]\n\n[bullet_item text=\"Bảo hành 5 nam\"]\n\n[button text=\"+ Xem chi tiết\" letter_case=\"lowercase\" radius=\"4\" link=\"#\" target=\"_blank\"]\n\n[/ux_price_table]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"195\" img_width=\"92\" pos=\"left\"]\n<h3><span style=\"color: #000000;\">Thiết kế</span></h3>\n<span style=\"font-size: 95%;\">Thiết kế kiến trúc, khai triển chi tiết bản vẽ, sơ đồ điện nước, kết cấu, phối cảnh ngoại thất, nội thất không gian 3 chiều, hồ sơ kỹ thuật thi công, hồ sơ xin cấp phép xây dựng, giám sát tác giả.</span>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"193\" img_width=\"92\" pos=\"left\"]\n<h3><span style=\"color: #000000;\">Thi công phần thuê</span></h3>\n<span style=\"font-size: 95%;\">Lập khái toán, liệt kê rõ chủng loại và khối lượng vật tư như: sắt thép, xi măng, ống nước, dây điện… Mua bảo hiểm cho công trình nhằm mục đích giảm thiểu mọi rủi ro trong quá trình thi công.</span>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"191\" img_width=\"92\" pos=\"left\"]\n<h3><span style=\"color: #000000;\">Hoàn thiện</span></h3>\n<span style=\"font-size: 95%;\">Lắp đặt cửa, lót sàn, trần thạch cao, sơn. Lắp đặt thiết bị vệ sinh, vòi nước, vòi sen tắm… Lắp đặt trang thiết bị điện: công tắc, đèn chiếu sáng, máy bơm, hệ thống cảm ứng thông minh…</span>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"188\" img_width=\"92\" pos=\"left\"]\n<h3><span style=\"color: #000000;\">Nội thất</span></h3>\n<span style=\"font-size: 95%;\">Liệt kê đầy đủ các vật dụng nội thất, chất liệu, mã số màu và giá thành cho mỗi sản phẩm. Thi công, sản xuất hoặc đặt hàng nội thất theo chỉ định của chuyên viên thiết kế nội thất.</span>\n\n[/featured_box]\n\n[/col]\n[col span__sm=\"12\" class=\"cot12-2\"]\n<h2 style=\"text-align: center;\">Chúng tôi với 15+ năm kinh nghiệm, bạn có thể làm việc với chúng tôi tại bất kỳ tỉnh thành nào!</h2>\n[/col]\n\n[/row]\n\n[/section]","Bảng giá","","inherit","closed","closed","","19-revision-v1","","","2018-11-25 13:06:39","2018-11-25 06:06:39","","19","https://tppone.com/demo/noithat6/19-revision-v1/","0","revision","","0"),
